const fs = require("fs");

function readableHindiConvertor(unreadableHindi) {
    return unreadableHindi.replace(/&#(\d+);/g, function (match, dec) {
        return String.fromCharCode(dec);
    });
}

let station_json = {};

for (let i = 0; i < station_english.length; i++) {
    let station_code = station_hindi[i]["code"];
    let english_name = station_english[i]["name"];
    let hindi_name = station_hindi[i]["name"];

    // converting from unreadable hindi to readable hindi.
    hindi_name = readableHindiConvertor(hindi_name);

    hindi_name = station_json[station_code] = {
        serial_nummber: i,
        english_name: english_name,
        hindi_name: hindi_name,
    };
}

let json_data = JSON.stringify(station_json, null, 2);

fs.writeFile("new.json", json_data, (err) => {
    if (err) {
        console.log("Some error happened");
        return;
    }
    console.log("Finised!!!!!!!");
});
